INSERT INTO artisans VALUES (188, 'WEONESL', 'M000188', 'Weasels on Easels', '', 'Hello! My name is Ashaeda! I am the maker at Weasels on Easels with support from my loving husband, Arctonyx. I have been creating fine art since 2012 and fursuits since 2014. I also created the Darss Edar species. We work on a queue based system with a capped queue only taking work a few times a year as it goes out. All of my work is double stitched, and crafted with the utmost care in close relation to the customer so we can be sure its exactly what you want and will be around for years to come!', '2014-07', 'US', 'Oregon', 'Portland', replace ('Artistic liberty commissions\nPremades\nStandard commissions', '\n', char (10)), replace ('Kemono\nRealistic\nSemi Realistic\nSemi Toony\nToony', '\n', char (10)), 'Quad Suits', replace ('Bodysuits (as parts/separate)\nFeetpaws (as parts/separate)\nFull digitigrade\nFull plantigrade\nHandpaws (as parts/separate)\nHead (as parts/separate)\nMini partial (head + handpaws + tail)\nPartial (head + handpaws + tail + feetpaws)\nTails (as parts/separate)\nThree-fourth (head + handpaws + tail + legs/pants + feetpaws)', '\n', char (10)), replace ('Fine Art\nDigital Art\nMakers Kits\nHead bases\nFursuit Making Parts\nFursuit Materials', '\n', char (10)), replace ('Adjustable eyebrows\nAdjustable/wiggle ears\nAttached handpaws and feetpaws\nAttached tail\nExchangeable hairs\nExchangeable tongues\nFollow-me eyes\nIn-head fans\nIndoor feet\nLED eyes\nLED/EL lights\nMovable jaw\nOutdoor feet\nRemovable eyelids\nRemovable horns/antlers\nWashable heads', '\n', char (10)), replace ('Fully Lined Bodysuits\nRemovable Padding\nPockets for Cooling Cores\nVents\nPockets (internal or external)\nHidden, removable Tile in the head for theft prevention\nNeck Pockets', '\n', char (10)), replace ('We can taks up to 3 and 6 month payment plans with 50% down. All work is added to the queue when paid in full to make it fair to other customers. The sooner you pay it off, the sooner it in the active queue. We have a capped payment plan queue and a capped queue as a whole so they are in line with each other. Specifics are generally based on a case by case basis. Further info below:\n\n3 month Payment Plan ($800+ USD)\nFor 3 month payment plans, we require a 50% non-refundable downpayment to cover materials and overhead costs and the rest to be paid off in 3 months with a minimum payment of 1/3 of the remaining by the 5th of each month. There are no fees to pay it off early, but there is a $75 fee if payment is late in a month. Your suit is added to the queue when it has been paid in full and shipping is charged at completion. There is a $50 discount if the deposit is paid via cashier check or money order. 3 month payment plans are only eligible on purchases of at at least $800 after any discounts. \n\n6 month Payment Plan ($2000+ USD)\nFor 6 month payment plans, we require a 50% non-refundable downpayment to cover materials and overhead costs and the rest to be paid off in 6 months with a minimum payment of 1/6 of the remaining by the 5th of each month. There are no fees to pay it off early, but there is a $75 fee if payment is late in a month. Your suit is added to the queue when it has been paid in full and shipping is charged at completion. There is a $75 discount if the deposit is paid via cashier check or money order. 6 month payment plans are only eligible on purchases of at at least $2000 after any discounts.', '\n', char (10)), 'Any species', '', 'English', '', '', '', '', '', '', '', '', 'FEEDBACK', 'E-MAIL', 'E-MAIL: a***r@weas***********.com', '');
