INSERT INTO artisans VALUES (330, 'SCHRSTS', '', 'Schorsuits', '', 'Heya! I make all the suits in my free time with all the love I have. I''d be more than happy to help you bring your character to life so feel free to message me with any questions.', '2019-06', 'NL', '', 'Apeldoorn', 'Standard commissions', 'Toony', '', replace ('Bodysuits (as parts/separate)\nFeetpaws (as parts/separate)\nFull digitigrade\nFull plantigrade\nHandpaws (as parts/separate)\nHead (as parts/separate)\nMini partial (head + handpaws + tail)\nPartial (head + handpaws + tail + feetpaws)\nTails (as parts/separate)\nThree-fourth (head + handpaws + tail + legs/pants + feetpaws)', '\n', char (10)), replace ('Props\nWearables', '\n', char (10)), replace ('Adjustable eyebrows\nAttached handpaws and feetpaws\nAttached tail\nExchangeable tongues\nIn-head fans\nIndoor feet\nOutdoor feet\nRemovable horns/antlers\nWashable heads', '\n', char (10)), 'Removable eyes', '40% upfront, other to be discussed', replace ('Canines\nLupines\nFelines\nFantasy creatures\nEtc.', '\n', char (10)), '', replace ('Dutch\nEnglish', '\n', char (10)), '', '', '', '', '', '', '', '', 'FEEDBACK', 'E-MAIL', 'E-MAIL: sc******ts@gm*****om', '');
INSERT INTO artisans VALUES (331, 'FGTFLFF', '', 'Furgetful Fae Fursuits', '', 'Richmond-based small fursuit maker who specializes in lovingly sewn pieces that bring your character to life!', '2017-08', 'US', 'Virginia', 'Richmond', replace ('Artistic liberty commissions\nPremades\nStandard commissions', '\n', char (10)), replace ('Kemono\nToony', '\n', char (10)), '', replace ('Feetpaws (as parts/separate)\nHandpaws (as parts/separate)\nHead (as parts/separate)\nMini partial (head + handpaws + tail)\nPartial (head + handpaws + tail + feetpaws)\nTails (as parts/separate)', '\n', char (10)), replace ('Arm sleeves\nPlush props\nFursuit sprays', '\n', char (10)), replace ('Adjustable eyebrows\nExchangeable tongues\nFollow-me eyes\nIndoor feet\nRemovable blush\nRemovable eyelids\nWashable heads', '\n', char (10)), 'Whiskers', '30%-50% upfront, and then payments as able until fully paid.', 'Any species that is furry! (canines, felines, fur dragons, horses, rodents, bats, etc.)', 'Nothing on the hard pass list, but I do not have experience with scalies or other animals without fur. I am willing to try anything!', 'English', '', '', '', '', '', '', '', '', 'FEEDBACK', 'E-MAIL', 'E-MAIL: ki****23@gm*****om', '');
INSERT INTO artisans VALUES (332, 'TKC2019', '', 'Twilight Knights Cosplay (TKC)', '', 'We make everything from fursuits, to cosplay, larp gear and everything in between! TKC aims to be your one stop shopping destination for all your costuming needs!', '2014-06', 'CA', 'Ontario', 'Ottawa', replace ('Artistic liberty commissions\nPremades\nStandard commissions', '\n', char (10)), replace ('Kemono\nRealistic\nToony', '\n', char (10)), '', replace ('Bodysuits (as parts/separate)\nFeetpaws (as parts/separate)\nFull digitigrade\nFull plantigrade\nHandpaws (as parts/separate)\nHead (as parts/separate)\nMini partial (head + handpaws + tail)\nPartial (head + handpaws + tail + feetpaws)\nTails (as parts/separate)', '\n', char (10)), replace ('Hoodies\nKigirumis\nCosplay\nArmour\nWeapon props\nFursuit props\nBandanas\nFursuit sprays\nDecals\nAnd much much more', '\n', char (10)), replace ('Adjustable eyebrows\nAttached tail\nElectronics/animatronics\nExchangeable hairs\nExchangeable tongues\nFollow-me eyes\nIn-head fans\nIndoor feet\nLED eyes\nLED/EL lights\nMovable jaw\nOutdoor feet\nRemovable eyelids\nRemovable horns/antlers\nWashable heads', '\n', char (10)), '', '30% non refundable upfront remaining 70% over a period of time up to 12 months on fullsuits.', 'Any species', '', 'English', '', '', '', '', '', '', 'ABSOLUTELY NO M##SUITS/Y##F SUITS <--- it''s hashed to avoid search engines', '', 'ANNOUNCEMENTS', 'E-MAIL', 'E-MAIL: s**a@l*****a', '');
INSERT INTO artisans VALUES (333, 'BLUEWSF', '', 'Blue Wolf Studio Fursuit', 'Nuclerfurcreations', 'Welcome To Blue Wolf Studio Fursuit - fursuit maker from Costa Rica, Central America. We specialize in the production of suits, costumes or fursuit made with synthetic fur, quality at a low price', '2014-01', 'CR', '', 'Heredia', replace ('Premades\nStandard commissions', '\n', char (10)), replace ('Semi Realistic\nSemi Toony\nToony', '\n', char (10)), '', replace ('Full digitigrade\nFull plantigrade\nHead (as parts/separate)\nThree-fourth (head + handpaws + tail + legs/pants + feetpaws)', '\n', char (10)), '', replace ('Follow-me eyes\nIn-head fans\nIndoor feet\nLED eyes\nMovable jaw\nOutdoor feet\nWashable heads', '\n', char (10)), '', '50% initial payment', 'Anyone since we like to experience new species', '', replace ('English\nSpanish', '\n', char (10)), '', '', '', '', '', '', '', '', 'NO', 'TELEGRAM', 'TELEGRAM: @D****y', '');
INSERT INTO artisans VALUES (334, 'RAMBLEZ', '', 'Ramble Studios (Aka Ray-Ray Rambles)', '', 'Hello! I''m Ray-Ray, a newer American maker. I love working with minors (if given parental permission) & weird species are my jam. I like gross & gruesome characters & features as well as anything unsettling. Turnaround is usually 1-3 months, keeping it on the shorter side if it''s a commission. Prices range from 350 - 470 for a head. Message me for pricing. Not often open for commissions, but always excited to see possible future work! I''m always excited to talk, hit me up!', '2017-09', 'US', 'Washington', 'Seattle', replace ('Artistic liberty commissions\nPremades\nStandard commissions', '\n', char (10)), replace ('Semi Toony\nToony', '\n', char (10)), 'I am excited to branch out and try new styles', replace ('Head (as parts/separate)\nMini partial (head + handpaws + tail)\nTails (as parts/separate)', '\n', char (10)), replace ('Arm sleeves\nEars\nTails\nBases\nTongues\nOther', '\n', char (10)), replace ('Exchangeable hairs\nExchangeable tongues\nFollow-me eyes\nWashable heads', '\n', char (10)), 'I can add features if the client wants on request, but I typically keep my heads simple.', '50% upfront 50% at shipping or 100% upfront', replace ('I greatly prefer uncommon species and will be much more excited to work on such species. I do all, but uncommon is prefered.\nElephants\nCaracals\nSheeps\nBirds\nEtc.', '\n', char (10)), 'I will do any but I prefer not to do canines', 'English', '', '', '', '', '', '', 'I work with minors if given parental permission.', '', 'ANNOUNCEMENTS', 'E-MAIL', 'E-MAIL: rav********777@gm*****om', '');
