INSERT INTO artisans VALUES (339, 'TOPNKDS', '', 'That One Pink Dog Studios', '', 'We are a fursuit making business from Phoenix, AZ that specializes in affordable adorable toony suits to help you express yourself', '2018-06', 'US', 'Arizona', 'Phoenix', replace ('Artistic liberty commissions\nPremades\nStandard commissions', '\n', char (10)), 'Toony', '', replace ('Bodysuits (as parts/separate)\nFeetpaws (as parts/separate)\nFull plantigrade\nHandpaws (as parts/separate)\nHead (as parts/separate)\nMini partial (head + handpaws + tail)\nPartial (head + handpaws + tail + feetpaws)\nTails (as parts/separate)', '\n', char (10)), 'Arm sleeves (as parts/separate)', replace ('Attached tail\nExchangeable tongues\nFollow-me eyes\nOutdoor feet\nRemovable eyelids', '\n', char (10)), '', 'Pay in full if price is under $350. If $350+, 30% up front to reserve a slot, can pay in full or with monthly plan after that', 'Any species', 'Copyrighted characters', 'English', '', '', '', '', '', '', '', '', 'FEEDBACK', 'E-MAIL', 'E-MAIL: thato***********udios@gm*****om', '');
INSERT INTO artisans VALUES (340, 'SANDCAT', '', 'Sandcat Customs', '', 'Thanks for visiting us here at Sandcat Customs! This company is owned and operated by Aleyna Sand  local Pittsburgh fursuiter, and also a full-time nurse. I''ve been on the sidelines of the fandom, so to speak, for many years, but recently decided to dive right in with both paws and make fursuits!', '2018-06', 'US', 'Pennsylvania', 'Pittsburgh', replace ('Artistic liberty commissions\nPremades\nStandard commissions', '\n', char (10)), replace ('Kemono\nSemi Toony\nToony', '\n', char (10)), '', replace ('Handpaws (as parts/separate)\nHead (as parts/separate)\nMini partial (head + handpaws + tail)\nTails (as parts/separate)', '\n', char (10)), '', replace ('Exchangeable hairs\nExchangeable tongues\nFollow-me eyes\nIn-head fans\nLED eyes\nMovable jaw\nRemovable horns/antlers', '\n', char (10)), '', '35% non-refundable deposit, remainder due within 4 weeks of project completion. Parts under $200 require 100% up front.', '', replace ('Birds\nReptiles', '\n', char (10)), 'English', '', '', '', '', '', '', '', '', 'FEEDBACK', 'TELEGRAM', 'TELEGRAM: @Al******nd', '');
INSERT INTO artisans VALUES (341, 'NYYOTE0', '', 'Nyyote', '', 'I am a fursuit maker based in the US, who is interested in trying out different/unique species, I also provide accessories of different types.', '2012-07', 'US', 'Indiana', '', replace ('Artistic liberty commissions\nPremades\nStandard commissions', '\n', char (10)), 'Toony', '', replace ('Feetpaws (as parts/separate)\nHandpaws (as parts/separate)\nHead (as parts/separate)\nMini partial (head + handpaws + tail)\nPartial (head + handpaws + tail + feetpaws)\nTails (as parts/separate)\nThree-fourth (head + handpaws + tail + legs/pants + feetpaws)', '\n', char (10)), replace ('Digitigrade legs\nArm sleeves\nLeg sleeves', '\n', char (10)), replace ('Attached handpaws and feetpaws\nAttached tail\nExchangeable hairs\nExchangeable tongues\nFollow-me eyes\nOutdoor feet\nRemovable eyelids\nWashable heads', '\n', char (10)), replace ('Ear vents\nAccessories\nPoseable tongue\nHollow foam digitigrade legs and feetpaws', '\n', char (10)), '45% upfront for a slot, rest before completion', 'Any species', 'I''d prefer not to do any pokemon/digimon, but still ask since it depends on the design', 'English', '', '', '', '', '', '', '', '', 'FEEDBACK', 'E-MAIL', 'E-MAIL: 0k*****ls@gm*****om', '');
