INSERT INTO artisans VALUES (343, 'MXNCHES', '', 'maxyncheese', '', 'Hiya! I''m maxyncheese, and my passion is bringing your character to life! Maxyncheese offers affordable fursuits and payment plans, customized to our customers needs :) I include lots of work in progress pictures and videos, as well as quick responses!', '2019-07', 'US', '', '', replace ('Artistic liberty commissions\nPremades\nStandard commissions', '\n', char (10)), 'Toony', '', replace ('Bodysuits (as parts/separate)\nFeetpaws (as parts/separate)\nFull digitigrade\nFull plantigrade\nHandpaws (as parts/separate)\nHead (as parts/separate)\nMini partial (head + handpaws + tail)\nPartial (head + handpaws + tail + feetpaws)\nTails (as parts/separate)\nThree-fourth (head + handpaws + tail + legs/pants + feetpaws)', '\n', char (10)), replace ('Props\nArt / badges\nAccessories', '\n', char (10)), replace ('Adjustable/wiggle ears\nAttached tail\nExchangeable hairs\nExchangeable tongues\nFollow-me eyes\nIndoor feet\nOutdoor feet\nRemovable eyelids\nRemovable horns/antlers', '\n', char (10)), '', 'I prefer everything up front, but I am very flexible with payment plans! I require %30 upfront for items of $130 or more', 'Most species', replace ('Elephants\nBirds\nRhinos\nLizards', '\n', char (10)), 'English', '', '', '', '', '', '', '', '', 'ANNOUNCEMENTS', 'E-MAIL', 'E-MAIL: ma*******se@gm*****om', '');
INSERT INTO artisans VALUES (345, 'MEEPSMM', '', 'Meep''s Marvelous Monstrosities', '', 'Meep''s Marvelous Monstrosities is a small UK maker, based in North Wales who loves bringing people''s characters to life, and only uses templates and bases created entirely by them. Meep does both fursuit and art commissions so feel free to inquire about either! Meep''s Marvelous Monstrosites is happy to try different options on fursuits and has multiple different styles to choose from and is happy to work with those on a smaller budget and offers payment plans on everything.', '2015-04', 'GB', '', '', replace ('Artistic liberty commissions\nPremades\nStandard commissions', '\n', char (10)), replace ('Semi Realistic\nSemi Toony\nToony', '\n', char (10)), '', replace ('Bodysuits (as parts/separate)\nFeetpaws (as parts/separate)\nFull digitigrade\nFull plantigrade\nHandpaws (as parts/separate)\nHead (as parts/separate)\nMini partial (head + handpaws + tail)\nPartial (head + handpaws + tail + feetpaws)\nTails (as parts/separate)\nThree-fourth (head + handpaws + tail + legs/pants + feetpaws)', '\n', char (10)), replace ('Props\nPlushies\nWings\nHoodies\nJust ask', '\n', char (10)), replace ('Adjustable eyebrows\nAdjustable/wiggle ears\nAttached handpaws and feetpaws\nExchangeable hairs\nExchangeable tongues\nFollow-me eyes\nIndoor feet\nOutdoor feet\nRemovable eyelids', '\n', char (10)), replace ('Magnetic wings\nDigi feetpaws\nDrybrushing\nAsk about anything wanted and see my website', '\n', char (10)), '30% upfront for fullsuits, 40% upfront for partials and 50% upfront for parts, each 100 minimum per month, or more depending on the total cost quoted.', replace ('Canines\nFelines\nMustelids\nRodents\nReptiles\nBirds\nUngulates\nEquines\nAny mythical or unique species', '\n', char (10)), '', 'English', '', '', '', '', '', '', 'Original country: Wales', '', 'ANNOUNCEMENTS', 'E-MAIL', 'E-MAIL: squ*******ton@gm*****om', '');
