INSERT INTO artisans VALUES (355, 'SKYSUIT', '', 'Skylight Suits', '', 'Hello! I''m Skylight, and I make suits! I''m getting into the fursuit business to help pay for my expenses and keep myself afloat after immigrating to Canada. I''m happy to tackle most any project and I am willing to negotiate prices, character concepts, and so forth very heavily. I love OC species or any unique character ideas and love to challenge myself with creative ways to fulfill requests. Please consider commissioning me so I can work with you on your dream suit!', '2017-08', 'CA', 'Ontario', 'Thunder Bay', replace ('Artistic liberty commissions\nPremades\nStandard commissions', '\n', char (10)), replace ('Semi Toony\nToony', '\n', char (10)), '', replace ('Full digitigrade\nFull plantigrade\nHead (as parts/separate)\nMini partial (head + handpaws + tail)\nPartial (head + handpaws + tail + feetpaws)\nThree-fourth (head + handpaws + tail + legs/pants + feetpaws)', '\n', char (10)), '', replace ('Attached handpaws and feetpaws\nExchangeable tongues\nFollow-me eyes\nIndoor feet\nMovable jaw', '\n', char (10)), '', '100% upfront/50% upfront to reserve a slot and 10% each next month.', replace ('Felines\nCanines\nDragons\nSergals\nDutch Angel Dragons\nSelf-made species\nSharks', '\n', char (10)), '', 'English', '', '', '', '', '', '', '', '', 'ANNOUNCEMENTS', 'TELEGRAM', 'TELEGRAM: @Sky******olf', '');
