INSERT INTO artisans VALUES (367, 'BETTAFS', '', 'Betta''s Fursuit Studios', '', 'Betta''s Fursuit Studios specializes in handmade, custom high quality partial fursuits! We strive for innovating designs that have rarely, if not, never seen before on a fursuit! We have yet had a bad review and our streak for 5 star customer service is still ongoing!', '2018-01', 'US', 'Virginia', 'Chesapeake', replace ('Artistic liberty commissions\nPremades\nStandard commissions', '\n', char (10)), 'Toony', '', replace ('Feetpaws (as parts/separate)\nHandpaws (as parts/separate)\nHead (as parts/separate)\nMini partial (head + handpaws + tail)\nPartial (head + handpaws + tail + feetpaws)\nTails (as parts/separate)', '\n', char (10)), 'Arm sleeves', replace ('Exchangeable tongues\nLED/EL lights\nOutdoor feet', '\n', char (10)), 'Removable eyelids', '50% upfront to reserve a slot, pay rest in less than 1 month', replace ('Canines\nBig cats\nSmall cats\nDragons\nRabbits\nBirds\nDeers\nProtogens (for paws and tail ONLY)\nDutch Angel Dragons (Tail, paws and feet paws ONLY)', '\n', char (10)), replace ('Raptor masks\nFishes\nRodents\nSergals\nBats', '\n', char (10)), replace ('English\nSpanish', '\n', char (10)), '', '', '', '', '', '', '', '', 'FEEDBACK', 'E-MAIL', 'E-MAIL: be******04@gm*****om', '');
