INSERT INTO artisans VALUES (369, 'NAUTICR', '', 'Nautical Creations', '', 'Hi I''m Basil, from Nautical Creations, I make cool unique fursuits like the ones you see on my FA,FB or instagram I started making suits in 2017 with a Reindeer head base and later that year made our first mini partial - a Sergal named Syleron Tripplepoint Tripplepoint I offer the best I can, as much as I can where every one of my suits and other commissions are tested by myself to ensure you will get the best quality that you deserve and you will love.', '2017-06', 'ZA', '', 'Krugersdorp', replace ('Artistic liberty commissions\nPremades\nStandard commissions', '\n', char (10)), replace ('Semi Realistic\nSemi Toony\nToony', '\n', char (10)), '', replace ('Bodysuits (as parts/separate)\nFeetpaws (as parts/separate)\nFull digitigrade\nFull plantigrade\nHandpaws (as parts/separate)\nHead (as parts/separate)\nMini partial (head + handpaws + tail)\nPartial (head + handpaws + tail + feetpaws)\nTails (as parts/separate)\nThree-fourth (head + handpaws + tail + legs/pants + feetpaws)', '\n', char (10)), replace ('Cosplays\nCollars\nHarness\nLeather work\nWings\nBespoke jewellery\nProps\nFursuit sneakers', '\n', char (10)), replace ('Attached handpaws and feetpaws\nAttached tail\nExchangeable hairs\nIn-head fans\nIndoor feet\nLED eyes\nLED/EL lights\nMovable jaw\nOutdoor feet', '\n', char (10)), replace ('Always includes removable digi padding pillows\nRemovable wings\nRemovable padding', '\n', char (10)), 'Payment plans depends on what costumer can afford at the given point, but I do charge $120 extra for long payment plans', 'Any species', '', replace ('Afrikaans\nEnglish', '\n', char (10)), '', '', '', '', '', '', '', '', 'FEEDBACK', 'E-MAIL', 'E-MAIL: Naut**********onza@gm*****om', '');
