INSERT INTO artisans VALUES (374, 'LIVBSTS', '', 'LivingBeasts', '', 'Greetings! I am a maker that loves to craft and bring characters to life. I focus on using high quality materials and communicating with clients trough the creation process. I also like to experiment by making premade fursuits.', '2018-05', 'NO', '', '', replace ('Premades\nStandard commissions', '\n', char (10)), replace ('Semi Realistic\nToony', '\n', char (10)), '', replace ('Feetpaws (as parts/separate)\nHandpaws (as parts/separate)\nHead (as parts/separate)\nMini partial (head + handpaws + tail)\nPartial (head + handpaws + tail + feetpaws)\nTails (as parts/separate)', '\n', char (10)), replace ('Fursuit plush props\nRepairs\nEars', '\n', char (10)), replace ('Adjustable/wiggle ears\nExchangeable tongues\nFollow-me eyes\nIndoor feet\nMovable jaw\nOutdoor feet\nRemovable eyelids', '\n', char (10)), '', '30% up front to reserve a slot, monthly payments can be discussed', 'Any species', '', replace ('English\nNorwegian', '\n', char (10)), '', '', '', '', '', '', '', '', 'ANNOUNCEMENTS', 'TELEGRAM', 'TELEGRAM: @do******ar', '');
INSERT INTO artisans VALUES (375, 'RKEMONO', '', 'Rising Sun Kemono', '', 'Rising Sun Kemono is a Kemono creator run by Fudoki-san and Keba-kun. We are full service. Our Fursuits are all made in-house. We produce everything ourselves and do not rely on outside companies for pieces (except the Fur, LED''s, magnets, etc). We produce all of our own patterns, foam head base, eyes, teeth, claws, paw-pads, misc parts, etc. With this information you always know that your suit is fully custom and unique to you!', '2010-08', 'US', 'Florida', 'Orlando', replace ('Premades\nStandard commissions', '\n', char (10)), 'Kemono', '', replace ('Full digitigrade\nFull plantigrade\nHead (as parts/separate)\nPartial (head + handpaws + tail + feetpaws)\nThree-fourth (head + handpaws + tail + legs/pants + feetpaws)', '\n', char (10)), '', replace ('Electronics/animatronics\nExchangeable hairs\nExchangeable tongues\nIn-head fans\nIndoor feet\nLED/EL lights\nOutdoor feet\nRemovable horns/antlers', '\n', char (10)), '', '30% Deposit for material and to reserve a slot, 100% before work begins', replace ('Canines\nDragons\nBig cats\nHybrids\nBirds\nHorses', '\n', char (10)), '', replace ('English\nJapanese', '\n', char (10)), '', '', '', '', '', '', '', '', 'FEEDBACK', 'E-MAIL', 'E-MAIL: RS****no@gm*****om', '');
INSERT INTO artisans VALUES (376, 'NYXIACR', '', 'Nyxia Creations', 'TakaraFur Studios', 'We are a a small, independent artist, costume and fursuit maker from the UK. We specialize in fursuits and art but are willing to make most costume props and attire. Most things you can think of we will likely be willing to try out!', '2014-06', 'GB', '', 'Lincolnshire', replace ('Artistic liberty commissions\nStandard commissions', '\n', char (10)), replace ('Semi Realistic\nToony', '\n', char (10)), '', replace ('Feetpaws (as parts/separate)\nHandpaws (as parts/separate)\nHead (as parts/separate)\nMini partial (head + handpaws + tail)\nPartial (head + handpaws + tail + feetpaws)\nTails (as parts/separate)', '\n', char (10)), replace ('Accessories\nEar headsets\nCosplay armour\nCosplay props\nCosplay weapons\nFursuit props\nFursuit bandanas', '\n', char (10)), replace ('Adjustable/wiggle ears\nAttached tail\nExchangeable hairs\nExchangeable tongues\nFollow-me eyes\nIn-head fans\nIndoor feet\nOutdoor feet\nRemovable horns/antlers', '\n', char (10)), '', '30% upfront at least, then pay whatever amount you like whenever. just as long as all is payed off before shipping.', 'Most species', replace ('Protogens\nPrimagens\nGem raptors', '\n', char (10)), 'English', '', '', '', '', '', '', '', '', 'CORRECTIONS', 'E-MAIL', 'E-MAIL: as*******ia@gm*****om', '');
INSERT INTO artisans VALUES (377, 'BROKESS', '', 'Broken Stitches Suits', '', 'I specialize in unusual species, and suits catering to disabled suiters!', '2019-06', 'US', 'Pennsylvania', 'Pittsburgh', replace ('Artistic liberty commissions\nStandard commissions', '\n', char (10)), 'Toony', '', replace ('Bodysuits (as parts/separate)\nFeetpaws (as parts/separate)\nFull digitigrade\nFull plantigrade\nHandpaws (as parts/separate)\nHead (as parts/separate)\nMini partial (head + handpaws + tail)\nPartial (head + handpaws + tail + feetpaws)\nTails (as parts/separate)', '\n', char (10)), '', replace ('Adjustable eyebrows\nExchangeable tongues\nFollow-me eyes\nOutdoor feet\nRemovable eyelids\nRemovable horns/antlers', '\n', char (10)), 'Removable padding', '50% upfront, payment plans discussed individually after initial 50%', 'Most species - probably less likely to do unusual species like aquatics or unusually-shaped reptiles or reptiles', '', replace ('English\nIntermediate Spanish\nJapanese', '\n', char (10)), '', '', '', '', '', '', '', '', 'FEEDBACK', 'TWITTER', 'TWITTER: @Val******hes', '');
INSERT INTO artisans VALUES (378, 'ALPOMEG', '', 'Alpha & Omega Studios', '', 'Hello, we are Alpha & Omega Studios! We are a fursuit making business based out of Mississippi! We''ve paired up with Kato''s Creations to give you even more options for your suits!', '2012-03', 'US', 'Mississippi', 'Mathiston', replace ('Artistic liberty commissions\nPremades\nStandard commissions', '\n', char (10)), replace ('Kemono\nKigurumi\nRealistic\nSemi Realistic\nSemi Toony\nToony', '\n', char (10)), 'Plush', replace ('Bodysuits (as parts/separate)\nFeetpaws (as parts/separate)\nFull digitigrade\nFull plantigrade\nHandpaws (as parts/separate)\nHead (as parts/separate)\nMini partial (head + handpaws + tail)\nPartial (head + handpaws + tail + feetpaws)\nTails (as parts/separate)\nThree-fourth (head + handpaws + tail + legs/pants + feetpaws)', '\n', char (10)), replace ('Ears\nHalf Suits (as parts/separate)\nHead bases\nNSFW items\nProps\nPlushies\nHarnesses\nCollars\nAnything by request', '\n', char (10)), replace ('Adjustable eyebrows\nAdjustable/wiggle ears\nAttached handpaws and feetpaws\nAttached tail\nElectronics/animatronics\nExchangeable hairs\nExchangeable tongues\nFollow-me eyes\nIn-head fans\nIndoor feet\nLED eyes\nLED/EL lights\nMovable jaw\nOutdoor feet\nRemovable eyelids\nRemovable horns/antlers', '\n', char (10)), replace ('Squeekers\nFinger escapes\nRemovable soft suiting parts\nAnything by request', '\n', char (10)), 'Payments are all monthly, minimum is $100 down and at least $100 each month. Payment plans are not available for parts or suits under $200.', 'Any species', '', replace ('English\nKorean (beginner)', '\n', char (10)), '', '', '', '', '', '', '', '', 'ANNOUNCEMENTS', 'E-MAIL', 'E-MAIL: alph**********ios1@gm*****om', '');
