PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE artisans_commissions_statues (id INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, artisan_id INTEGER NOT NULL, status BOOLEAN DEFAULT NULL, last_checked DATETIME DEFAULT NULL, reason VARCHAR (256) NOT NULL COLLATE BINARY, CONSTRAINT FK_4148D9A35ED3C7B7 FOREIGN KEY (artisan_id) REFERENCES artisans (id) NOT DEFERRABLE INITIALLY IMMEDIATE);
CREATE TABLE artisans_urls (id INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, artisan_id INTEGER NOT NULL, type VARCHAR (32) NOT NULL COLLATE BINARY, url VARCHAR (1024) NOT NULL COLLATE BINARY, last_success DATETIME DEFAULT NULL, last_failure DATETIME DEFAULT NULL, last_failure_code INTEGER NOT NULL, last_failure_reason VARCHAR (512) NOT NULL COLLATE BINARY, CONSTRAINT FK_45AAF3BC5ED3C7B7 FOREIGN KEY (artisan_id) REFERENCES artisans (id) NOT DEFERRABLE INITIALLY IMMEDIATE);
CREATE TABLE events (id INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, old_status BOOLEAN DEFAULT NULL, new_status BOOLEAN DEFAULT NULL, timestamp DATETIME NOT NULL, type VARCHAR (16) NOT NULL COLLATE BINARY, artisan_name VARCHAR (256) NOT NULL COLLATE BINARY, checked_url VARCHAR (1024) NOT NULL COLLATE BINARY, open_match CLOB NOT NULL COLLATE BINARY, closed_match CLOB NOT NULL COLLATE BINARY, description CLOB NOT NULL);
CREATE TABLE IF NOT EXISTS "artisans" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, 
	"maker_id"	VARCHAR (16) NOT NULL, 
	"former_maker_ids"	VARCHAR (64) NOT NULL, 
	"name"	VARCHAR (128) NOT NULL, 
	"formerly"	VARCHAR (256) NOT NULL, 
	"intro"	VARCHAR (512) NOT NULL, 
	"since"	VARCHAR (16) NOT NULL, 
	"country"	VARCHAR (16) NOT NULL, 
	"state"	VARCHAR (32) NOT NULL, 
	"city"	VARCHAR (32) NOT NULL, 
	"production_models"	VARCHAR (256) NOT NULL, 
	"styles"	VARCHAR (1024) NOT NULL, 
	"other_styles"	VARCHAR (256) NOT NULL, 
	"order_types"	VARCHAR (1024) NOT NULL, 
	"other_order_types"	VARCHAR (256) NOT NULL, 
	"features"	VARCHAR (1024) NOT NULL, 
	"other_features"	VARCHAR (1024) NOT NULL, 
	"payment_plans"	VARCHAR (256) NOT NULL, 
	"species_does"	VARCHAR (256) NOT NULL, 
	"species_doesnt"	VARCHAR (256) NOT NULL, 
	"languages"	VARCHAR (256) NOT NULL, 
	"production_models_comment"	VARCHAR (256) NOT NULL DEFAULT '', 
	"styles_comment"	VARCHAR (256) NOT NULL DEFAULT '', 
	"order_types_comment"	VARCHAR (256) NOT NULL DEFAULT '', 
	"features_comment"	VARCHAR (256) NOT NULL DEFAULT '', 
	"payment_methods"	VARCHAR (256) NOT NULL DEFAULT '', 
	"currencies_accepted"	VARCHAR (64) NOT NULL DEFAULT '', 
	"notes"	CLOB NOT NULL COLLATE BINARY, 
	"species_comment"	VARCHAR (256) NOT NULL DEFAULT '', 
	"contact_allowed"	VARCHAR (16) NOT NULL COLLATE BINARY, 
	"contact_method"	VARCHAR (32) NOT NULL COLLATE BINARY, 
	"contact_info_obfuscated"	VARCHAR (128) NOT NULL COLLATE BINARY, 
	"inactive_reason"	VARCHAR (512) NOT NULL COLLATE BINARY
);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX UNIQ_4148D9A35ED3C7B7 ON artisans_commissions_statues (artisan_id);
CREATE INDEX IDX_45AAF3BC5ED3C7B7 ON artisans_urls (artisan_id);
COMMIT;
